import React from 'react'
import "./Intro.css"
import {BG} from '../Images/intro-bg.jpg'

export const Intro = () => {
  return (
    <div className='intro'>
    <div className='mask'>
    <img src={BG} alt='' />
    </div>
    </div>
  )
}
